import Board from "../../../src/components/Board.vue";
import mountVue from "cypress-vue-unit-test";

Cypress.Commands.add("resetBoard", (rows, cols, mines) => {
  cy.get("input[name='reset-rows']")
    .clear()
    .type(rows);
  cy.get("input[name='reset-cols']")
    .clear()
    .type(cols);
  cy.get("input[name='reset-mines']")
    .clear()
    .type(mines);
  cy.get(".reset-container button").click();
});

Cypress.Commands.add("mockBoard", (myRows, myCols, myMines) => {
  const template = `
    <div id="app">
      <Board />
    </div>
  `;

  // const data = {
  //   message: 'Hello Vue!'
  // };

  const components = {
    Board
  };

  // that's all you need to do
  beforeEach(mountVue({ template, components }));

  it('shows hello', () => {
    cy.contains(".board-container");
  });

  // cy.stub(Board, "generateBoard", (rows, col, mines) => {
  //   Board
  // });
});
